import React from 'react';
import { Edit, Trash2, Users, Calendar, Clock, BookOpen } from 'lucide-react';

/**
 * Reusable CourseCard component
 * Displays course information in a consistent card format
 */
const CourseCard = ({ course, onEdit, onDelete, canEdit = false }) => {
  const formatDate = (dateString) => {
    if (!dateString) return 'Not set';
    try {
      return new Date(dateString).toLocaleDateString('en-US', {
        year: 'numeric',
        month: 'short',
        day: 'numeric'
      });
    } catch (error) {
      return 'Invalid date';
    }
  };

  const getStatusBadge = (isActive) => {
    return (
      <span
        className={`inline-flex items-center px-2.5 py-0.5 rounded-full text-xs font-medium ${
          isActive
            ? 'bg-green-100 text-green-800'
            : 'bg-red-100 text-red-800'
        }`}
      >
        {isActive ? 'Active' : 'Inactive'}
      </span>
    );
  };

  return (
    <div className="bg-white rounded-lg shadow-md hover:shadow-lg transition-shadow duration-200 border border-gray-200">
      {/* Header */}
      <div className="p-6 border-b border-gray-100">
        <div className="flex justify-between items-start">
          <div className="flex-1">
            <div className="flex items-center space-x-3 mb-2">
              <BookOpen className="h-5 w-5 text-blue-600" />
              <h3 className="text-lg font-semibold text-gray-900 truncate">
                {course.title || 'Untitled Course'}
              </h3>
            </div>
            <p className="text-sm text-gray-600 mb-3">
              <span className="font-medium">Code:</span> {course.course_code || 'N/A'}
            </p>
            {getStatusBadge(course.is_active)}
          </div>

          {/* Action Buttons */}
          {canEdit && (
            <div className="flex space-x-2">
              <button
                onClick={() => onEdit(course)}
                className="p-2 text-blue-600 hover:bg-blue-50 rounded-lg transition-colors"
                title="Edit Course"
              >
                <Edit className="h-4 w-4" />
              </button>
              <button
                onClick={() => onDelete(course)}
                className="p-2 text-red-600 hover:bg-red-50 rounded-lg transition-colors"
                title="Delete Course"
              >
                <Trash2 className="h-4 w-4" />
              </button>
            </div>
          )}
        </div>
      </div>

      {/* Content */}
      <div className="p-6">
        {/* Description */}
        {course.description && (
          <div className="mb-4">
            <p className="text-sm text-gray-700 line-clamp-3">
              {course.description}
            </p>
          </div>
        )}

        {/* Course Details */}
        <div className="grid grid-cols-1 sm:grid-cols-2 gap-4 text-sm">
          {/* Credits */}
          <div className="flex items-center space-x-2">
            <Clock className="h-4 w-4 text-gray-400" />
            <span className="text-gray-600">Credits:</span>
            <span className="font-medium">{course.credits || 0}</span>
          </div>

          {/* Enrollment Count */}
          <div className="flex items-center space-x-2">
            <Users className="h-4 w-4 text-gray-400" />
            <span className="text-gray-600">Enrolled:</span>
            <span className="font-medium">{course.enrolled_students_count || 0} students</span>
          </div>

          {/* Start Date */}
          <div className="flex items-center space-x-2">
            <Calendar className="h-4 w-4 text-gray-400" />
            <span className="text-gray-600">Start:</span>
            <span className="font-medium">{formatDate(course.start_date)}</span>
          </div>

          {/* End Date */}
          <div className="flex items-center space-x-2">
            <Calendar className="h-4 w-4 text-gray-400" />
            <span className="text-gray-600">End:</span>
            <span className="font-medium">{formatDate(course.end_date)}</span>
          </div>
        </div>

        {/* Instructor */}
        {course.instructor && (
          <div className="mt-4 pt-4 border-t border-gray-100">
            <div className="flex items-center space-x-2 text-sm">
              <span className="text-gray-600">Instructor:</span>
              <span className="font-medium text-gray-900">
                {course.instructor.first_name} {course.instructor.last_name}
              </span>
            </div>
          </div>
        )}
      </div>
    </div>
  );
};

export default CourseCard;
